import React from 'react';

class GetStartedBtn extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            hover: false
        }
    };

    toggleHover = () => {
        this.setState({hover: !this.state.hover})
    }

    render(){
        var getStartedBtnStyle;
        if (this.state.hover) {
            getStartedBtnStyle = {
                background:'#4BD575',
                height:88,
                Maxwidth:428,
                color: '#FAFBFB',
                cursor: 'pointer'
            }
        } else {
            getStartedBtnStyle = {
                color: '#000'
            }
        }
        return(
            <button 
                    style={getStartedBtnStyle}  
                    onMouseEnter={this.toggleHover}
                    onMouseLeave={this.toggleHover}>
                Get Started
            </button>        
            )
    }
}

export default GetStartedBtn;
